# Main Printer Configuration
[printer]
kinematics = corexy
max_velocity = 300
max_accel = 5000
max_z_velocity = 15
max_z_accel = 350
square_corner_velocity = 5.0

# System Settings
[idle_timeout]
timeout = 4800

[virtual_sdcard]
path = ~/printer_data/gcodes
on_error_gcode = CANCEL_PRINT

[display_status]
[respond]
[gcode_arcs]

